import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useRouteMatch,
    useParams
} from "react-router-dom";

import AppHeader from '../App-header/App-header';
import MainPage from '../MainPage';
import FilmsPage from '../FilmsPage';

function App() {
    return (
        <div className="App">
            <AppHeader/>
            <Router>
                <Switch>
                    <Route path="/">
                        <MainPage />
                    </Route>
                    <Route path="/Films">
                        <FilmsPage />
                    </Route>
                    <Route path="/Actors">
                        <MainPage />
                    </Route>
                </Switch>
            </Router>
        </div>
    );
}

export default App;
